    to correctly categorize several disbursements that were filed with incorrect election
    codes. Several disbursements were incorectly labled as 'primary' election contributions.
    Also, a $5,000 contribution to another political committee was incorrectly labled
    as a transfer in the July quarterly report. The amended July quarterly report
    now corrects this error. This change remedies the discrepencies that were showing
    up in the October quarterly report in the year-to-date disbursement line. Please
    contact me if you have any further questions.\n"
